        super(props);
        this.state = {
            username: this.props.username,
            email : this.props.useremail
        };
        console.log(this.state);
    }



    render(){
        console.log(" test.");

        return(
            <div>
            {this.state.username!="" && this.state.email!=""&&
                <DisplayIDForm
                username={this.state.username}
            />
            }
            </div>
        );
    }
}

export default withRouter(DisplayID);
